    <script>
        document.addEventListener('DOMContentLoaded', function () {
            const svg = document.getElementById('italia');
            const provinceNameDiv = document.getElementById('province-name');

            svg.addEventListener('mouseover', function (event) {
                if (event.target.tagName === 'path') {
                    const name = event.target.getAttribute('data-name');
                    provinceNameDiv.textContent = name;
                }
            });

            svg.addEventListener('mouseout', function (event) {
                if (event.target.tagName === 'path') {
                    provinceNameDiv.textContent = 'Passa sopra una provincia per visualizzarne il nome.';
                }
            });

            svg.addEventListener('click', function (event) {
                if (event.target.tagName === 'path') {
                    const file = event.target.getAttribute('data-file');
                    if (file) {
                        window.location.href = file;
                    }
                }
            });
        });
    </script>
